import React from "react";


const EventsPage = () => {
  const tablesData = [
    {
      title: "Таблица 1",
      image: "https://via.placeholder.com/150", // Используйте нужную ссылку на изображение
      data: [
        ["Ячейка 1.1", "Ячейка 1.2"],
        ["Ячейка 2.1", "Ячейка 2.2"],
        ["Ячейка 3.1", "Ячейка 3.2"],
        ["Ячейка 4.1", "Ячейка 4.2"]
      ]
    },
    {
      title: "Таблица 2",
      image: "https://via.placeholder.com/150", // Используйте нужную ссылку на изображение
      data: [
        ["Ячейка 1.1", "Ячейка 1.2"],
        ["Ячейка 2.1", "Ячейка 2.2"],
        ["Ячейка 3.1", "Ячейка 3.2"],
        ["Ячейка 4.1", "Ячейка 4.2"]
      ]
    },
    {
      title: "Таблица 3",
      image: "https://via.placeholder.com/150", // Используйте нужную ссылку на изображение
      data: [
        ["Ячейка 1.1", "Ячейка 1.2"],
        ["Ячейка 2.1", "Ячейка 2.2"],
        ["Ячейка 3.1", "Ячейка 3.2"],
        ["Ячейка 4.1", "Ячейка 4.2"]
      ]
    }
  ];

  return (
    <div className="app">
      {tablesData.map((table, index) => (
        <div className="table-container" key={index}>
          <h2>{table.title}</h2>
          <div className="content">
            <table border="1">
              <tbody>
                {table.data.map((row, rowIndex) => (
                  <tr key={rowIndex}>
                    <td>{row[0]}</td>
                    <td>{row[1]}</td>
                  </tr>
                ))}
              </tbody>
            </table>
            <img src={table.image} alt={table.title} />
          </div>
        </div>
      ))}
    </div>
  );
};

export default EventsPage;
